  return (
    <div className="relative">
      <MainDashboardTop />
    <div className="flex">
       <div> <img src="images/hostel1.jpeg" className="w-[90%] ml-[5%] md:w-[40%]"/></div>
       <div>
       <img src="images/hostel2.jpeg" className="w-[90%] ml-[5%] md:w-[40%]"/>
       </div>
    </div>
    </div>
  );
}

export default HostelPages;
